def calculate(data):
    convoy_data = data[0]
    headway = float(data[1])/60
    algorithm = data[2]
    k = 1
    step = 0.5
    optimality = False
    convoys = []

    for convoyID, features in convoy_data.items():
            convoy = Convoy(convoyID, features["origin"], features["destination"], features["length"]/1000, features["speed"], features["ready"], features["due"])
            convoys.append(convoy)

    env = Environment(convoys, headway, algorithm,optimality,k, step)

    feasible_solution, ub = best_choice(env)

    convoy_ids= []
    starts = []
    for conID, data in feasible_solution.items():
        convoy_ids.append(conID)
        starts.append(data[2])
    start_times, start_order = zip(*sorted(zip(starts, convoy_ids)))

    return [start_order, feasible_solution]

def addPaths(candidates, new_path, timestep, convoy):
    newpaths = []
    start = timestep
    while start < convoy.due_time - new_path['cost']:
        newpaths.append([new_path, start])
        start += timestep
    if convoy in candidates:
        candidates[convoy] += newpaths
    else:
        candidates[convoy] = newpaths

    candidates[convoy].sort(key=lambda x: x[0]['cost'] + x[1])

    return candidates


def k_shortest_routes_optimal(graph, convoy, k, k_start, timestep, candidate_paths):
    feasible_paths = []
    i = 0
    newpath = next_shortest_path(graph, convoy.origin, convoy.destination, convoy.speed, k_start, weight='weight')
    while i < k:
        arrival_time_new = newpath['cost']
        if convoy in candidate_paths:
            # print(candidate_paths)
            arrival_time_old = candidate_paths[convoy][0][0]['cost'] + candidate_paths[convoy][0][1]
            if arrival_time_new < convoy.due_time:
                if arrival_time_old < arrival_time_new:
                    feasible_paths.append([candidate_paths[convoy][0][0]['path'], candidate_paths[convoy][0][0]['cost'],
                                           candidate_paths[convoy][0][1]])
                    i += 1
                    candidate_paths[convoy].pop(0)
                elif arrival_time_new < convoy.due_time and arrival_time_old > arrival_time_new:
                    feasible_paths.append([newpath['path'], newpath['cost'], 0])
                    i += 1
                    k_start += 1
                    candidate_paths = addPaths(candidate_paths, newpath, timestep, convoy)
                    newpath = next_shortest_path(graph, convoy.origin, convoy.destination, convoy.speed, k_start,
                                                 weight='weight')
                else:
                    break
            else:
                feasible_paths.append([candidate_paths[convoy][0][0]['path'], candidate_paths[convoy][0][0]['cost'],
                                       candidate_paths[convoy][0][1]])
                i += 1
                candidate_paths[convoy].pop(0)
        else:
            if arrival_time_new < convoy.due_time:
                feasible_paths.append([newpath['path'], newpath['cost'], 0])
                i += 1
                k_start += 1
                candidate_paths = addPaths(candidate_paths, newpath, timestep, convoy)
                newpath = next_shortest_path(graph, convoy.origin, convoy.destination, convoy.speed, k_start,
                                             weight='weight')
            else:
                break
    return feasible_paths


def add_paths(graph, all_feasible_paths, added_paths, headway):
    new_paths = False
    extended_paths = all_feasible_paths

    paths = []
    convoys = []
    for convoy, path_list in all_feasible_paths.items():
        for path in path_list:
            paths.append(path)
            convoys.append(convoy)

    for i, selected_convoy in enumerate(convoys):
        selected_path_data = paths[i]
        other_convoys = []
        other_path_data = []
        for j in range(len(convoys)):
            if convoys[j] != selected_convoy:
                other_convoys.append(convoys[j])
                other_path_data.append(paths[j])

        for k, convoy in enumerate(other_convoys):
            path_data = other_path_data[k]
            for node in path_data[0]:
                if node in selected_path_data[0]:
                    if check_conflict(graph, selected_path_data, path_data, node, selected_convoy, convoy, headway):
                        arrival_at_node_1 = arrival_time(graph, node, selected_path_data[0], selected_convoy, selected_path_data[2])
                        arrival_at_node_2 = arrival_time(graph, node, path_data[0], convoy, path_data[2])
                        tail = convoy.length / convoy.speed + arrival_at_node_2
                        depature_time = tail - arrival_at_node_1 + headway
                        # print(arrival_at_node_1, tail, depature_time)
                        new_path = [selected_path_data[0], selected_path_data[1], depature_time]

                        if check_validity(new_path, added_paths):
                            added_paths.append(new_path)
                            extended_paths[selected_convoy].append(new_path)
                            new_paths = True

    if new_paths:
        return extended_paths, added_paths
    return False, added_paths


# function that checks if new_path is already present in old_paths
def check_validity(new_path, old_paths):
    for old_path in old_paths:
        if old_path[0] == new_path[0] and round(old_path[2],3) == round(new_path[2],3):
            return False
    return True

def add_timeintervals(paths, convoy, k, step):
    path = paths[convoy][-1]
    start = path[2]
    duration = path[1]
    arrival_time = start + duration
    for i in range(k):
        arrival_time += step
        start += step
        if arrival_time < convoy.due_time:
            paths[convoy].append([path[0], duration, start])
        else:
            break


